var imgData = "data:image/jpeg;base64,"
var doc = new jsPDF();
var pageHeight =
  doc.internal.pageSize.height || doc.internal.pageSize.getHeight();
var pageWidth = doc.internal.pageSize.width || doc.internal.pageSize.getWidth();
let height = 0;
let globalHeight = 0;
var percent = function (internalSize, element) {
  var index = element.indexOf("%");
  if (index > -1) {
    var getRealValue = element.slice(0, index);
    if (getRealValue > 100) getRealValue = 100;
    return ((internalSize - 5) * Number(getRealValue)) / 100;
  }
  return element;
};
function removePercent(heigth) {
  console.log(heigth);
  const index = heigth.indexOf("%");
  let getRealPart = heigth.substr(0, index);
  return Number(getRealPart);
}
function calculateTheLengthOfText(text, width, heigth) {
  return text.length / width - 1;
}
function addPage(heigth, top) {
  if (globalHeight >= heigth) {
    doc.addPage();
    globalHeight = top;
  }
}
class Container {
  constructor(lengths) {
    this.lengths = lengths;
    this.width = 0;
  }

  div(doc, style) {
    let border = style.border != undefined ? style.border : [255, 255, 255];
    let bgColor = style.bgColor != undefined ? style.bgColor : [255, 255, 255];
    let setColor = style.bgColor != undefined ? "FD" : undefined;
    doc.setDrawColor(...border);
    doc.setFillColor(...bgColor);
    let height = percent(pageHeight, (globalHeight + removePercent(style.heigth)) + '%');
    doc.rect(
      percent(pageHeight, style.marginLeft),
      height,
      percent(pageWidth, style.width),
      percent(pageWidth, style.padding),
      setColor
    );
  }
  th(doc, style) {
    let border = style.border != undefined ? style.border : [255, 255, 255];
    let bgColor = style.bgColor != undefined ? style.bgColor : [255, 255, 255];
    let setColor = style.bgColor != undefined ? "FD" : undefined;
    doc.setDrawColor(...border);
    doc.setFillColor(...bgColor);
    let height = percent(pageHeight, (globalHeight + removePercent(style.heigth)) + '%');
    doc.rect(
      percent(pageHeight, style.marginLeft),
      height,
      percent(pageWidth, style.width),
      percent(pageWidth, style.padding),
      setColor
    );
  }
  td(doc, style) {
    let border = style.border != undefined ? style.border : [255, 255, 255];
    let bgColor = style.bgColor != undefined ? style.bgColor : [255, 255, 255];
    let setColor = style.bgColor != undefined ? "FD" : undefined;
    doc.setDrawColor(...border);
    doc.setFillColor(...bgColor);
    let height = percent(pageHeight, (globalHeight + removePercent(style.heigth)) + '%');
    doc.rect(
      percent(pageHeight, style.marginLeft),
      height,
      percent(pageWidth, style.width),
      percent(pageHeight, style.padding),
      setColor
    );
  }
  splitText(text, size, width, font = "") {
    let lines = doc
      .setFont(font)
      .setFontSize(size)
      .splitTextToSize(text, width || undefined);
    return lines;
  }
  p(text, style, callBack = 0) {
    let addPosition = callBack;
    doc.setFont("", style.fontWeigth);
    doc.setFontSize(style.fontSize);
    let marginTopPercent = percent(pageHeight, (globalHeight + removePercent(style.marginTop)) + '%');
    let formatedText = text//this.splitText(text, style.fontSize, style.width, "");
    doc.text(
      percent(pageWidth, style.marginLeft),
      marginTopPercent,
      formatedText
    );
    marginTopPercent += addPosition;
  }

  hr(style) {
    doc.setFont("", 'bold');
    doc.setDrawColor(0, 0, 0)
    doc.setLineWidth(style.width || 0.5);
    doc.line(
      percent(pageWidth, style.marginLeft),
      percent(pageHeight, (globalHeight + removePercent(style.top)) + '%'),
      percent(pageWidth, style.marginRight),
      percent(pageHeight, (globalHeight + removePercent(style.bottom)) + '%')
    );
  }

  Image(src, style) {
    doc.addImage(
      src,
      "JPEG",
      percent(pageWidth, style.marginLeft),
      percent(pageWidth, globalHeight + removePercent(style.marginTop) + '%'),
      percent(pageWidth, style.width),
      percent(pageWidth, style.height)
    );
  }
}

var container = new Container();
function line(top, bottom, marginRight = "100%") {
  container.hr({
    top: top + globalHeight + "%",
    marginLeft: "2%",
    marginRight: marginRight,
    bottom: bottom + globalHeight + "%",
  });
}
function img(imgData, container) {
  let style = {
    marginTop: "2%",
    width: "25%",
    height: "15%",
    marginLeft: "1%",
  };
  container.Image(imgData, style);
}
img(imgData, container);

